Been keeping quiet and holding on to these for a minute. So stoked to see this stuff gone live in the world. An absolute pleasure it was to shoot the new @canamoffroad Maverick R launch imagery and campaign. Wow. And with an incredible team of humans from all over the place. The very few that really made my job as easy as it could be from creative to production to second shooting to assistance are: 
@kywinsor @_mariechristine_ @greggboydston @p.x.l.p.r.o.s 
This was a massive production and huge team. Huge thanks for a successful one.

